import React, {Component} from 'react'



class Login extends Component {
  render() {
      return (
          <body>
            <div>
              <div id= "universal-nav">
                <h2></h2>
              </div>
              <div id = "content-main">
                <div className = "modal-content">
                  <div className = "modal-wrapp">
                    <div className = "modal-form">
                      <div className = "login">
                        <div className = "form-container">
                          <h1 className = "form-heading-h1"><span>Iniciar sesión</span></h1>
                          <div className ="flex">
                            <p></p>
                            <label for = "username"><span>Usuario: </span></label>
                              <input type= "Text" className = "username" value></input>
                            <p></p>
                            <label for = "password">Contraseña: </label>
                              <input type= "Text" className = "password" value></input>
                            <p></p>
                            <button id="enter-button" type = "submit" className = "enter-button-login"><span>Ingrese</span></button>
                            <button id="register-button" type= "submit" className = "register-button-login"><span>Registrar</span></button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>


            <style jsx>{`
                body {
                  padding: 0rem;
                  margin: 0;
                  font-family: "Helvetica Neue",Arial,sans-serif;
                }
                h1 {
                  font-weight: 400;
                  font-family:"Helvetica Neue",Arial,sans-serif;
                }
                #universal-nav {


                  background: #fff;
                  border-bottom:1px solid #ececec;
                  height:50px;
                  position:relative;
                  z-index:2;

               }
               #content-main, .modal-content { 
                 background-color: #f4f4f4;
               }
               span { 
                 font-size: inherit;
                 margin: 0;
                 padding: 0;
                 border: 0;
                 vertical-align: baseline;
                 display: inline;
               }
               p {
                 font-size: 1rem;
                 line-height: 1.625rem;
                 padding: 0 0 15px;
               }
               input {
                 color: #323232;
                 font-size: 1rem;
                 -webkit-writing-mode: horizontal-tb!important;
               }
               .enter-button-login {
                 background-color: #0062ff;
                 border-color : #0062ff;
                 outline-color : #0062ff;
                 width: 190px;
                 max-width: 100%;
                 min-width: 160px;
                 text-align: left;
                 color: white;
                 outline: 3px solid;
                 margin: 8px 0 8px 3px;
                 border: 1px solid;
                 font-size: 16px;
                 line-height: 20px;
                 box-sizing : border-box;
                 cursor: pointer;
                 padding: 11px 18px;
               }

               .register-button-login {
                  background-color: #0062ff;
                  border-color : #0062ff;
                  outline-color : #0062ff;
                  width: 190px;
                  max-width: 100%;
                  min-width: 160px;
                  text-align: left;
                  color: white;
                  outline: 3px solid;
                  margin: 8px 0 8px 3px;
                  border: 1px solid;
                  font-size: 16px;
                  line-height: 20px;
                  box-sizing : border-box;
                  cursor: pointer;
                  padding: 11px 18px;
               }
              `}</style>


          </body>
      )
  }
}

export default Login
